import React from 'react'
import './../../style/banner.style'
const Banner = () => {
  return (
    <div className="banner">
      <div className="banner-content">
        <h1>Your Name</h1>
        <p>Web Developer | UX/UI Designer</p>
      </div>
    </div>
  )
}

export default Banner
